  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0108079 includes discrete
  sample and profile data collected from METEOR in the Adriatic Sea, Aegean Sea, Alboran
  Sea, Ionian Sea, Mediterranean Sea, Mediterranean Sea - Eastern Basin, Mediterranean
  Sea - Western Basin, North Atlantic Ocean, Strait of Gibraltar and Tyrrhenian Sea
  from 2011-04-05 to 2011-04-28. These data include Barium, CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON (DIC), DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE, NITRITE,
  Potential temperature (theta), SALINITY, SULFUR HEXAFLUORIDE (SF6), TOTAL ALKALINITY
  (TA), Tritium (Hydrogen isotope), WATER TEMPERATURE, pH, phosphate and silicate.
  The instruments used to collect these data include Alkalinity titrator, CTD, Coulometer
  for DIC measurement, bottle and spectrophotometer.nnThese data were collected by
  Toste Tanhua of Helmholtz-Zentrum Fr Ozeanforschung, M. Alvarez of Instituto de
  Investigaciones Marinas de Vigo and L. Mintrop of Marianda Marine Analytics and
  Data as part of the CLIVAR_Met_84_3_Med_Sea data set. CDIAC associated the following
  cruise ID(s) with this data set: CLIVAR_Met_84_3_Med_SeannThe International CLIVAR
  Global Ocean Carbon and Repeat Hydrography Program carries out a systematic and
  global re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes
  in storage and transport of heat, fresh water, carbon dioxide (CO2), and related
  parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
